import { StyleSheet } from "react-native";

export default StyleSheet.create({
  container: {
    padding: 5,
    margin: 10,
    backgroundColor: "white",
    borderRadius: 5,
    alignItems: "center",
  },
  title: {
    fontWeight: "bold",
    fontSize: 17,
  },
});
